import React from "react";

const Notes = () => {
    return (
        <>
         <header className="App-header">
          <img src="./logo.png" className="logo" alt="logo" />
          <h1 className="header">
            Rehearsal Notes
          </h1>
        <h2>Enter you rehearsal notes here</h2>
        </header>
        </>
    )
}

export default Notes;
